<p style="margin-top: 0; margin-bottom: 0;">VISI DAN MISI SD MUHAMMADIYAH 1 BALIKPAPANVISI Membentuk manusia muslim berakhlak mulia, percaya pada diri sendiri serta berguna bagi agama, masyarakat dan negaraMencetak kader intelektual berwawasan Islam yang kokoh dan kuatMISI Melaksanakan kegiatan belajar mengajar secara efektif dan menumbuhkan kesadaran serta wawasan ke-Islaman yang kokoh.Melaksanakan pembelajaran dan bimbingan serta kegiatan ekstrakurikuler secara efektif sehingga setiap siswa berkembang secara optimal sesuai dengan potensi yang dimilikinyaMendorong serta membantu setiap siswa untuk mengenali potensi dirinya serta menumbuhkan kenyataan terhadap ajaran agama Islam dan budaya, sehingga menjadi sumber kearifan dalam bertindak.Menerapkan Manajemen Berbasis Sekolah (MBS) dengan melibatkan seluruh warga sekolah dan kelompok masyarakat yang terkait dengan sekolah.KARTU PEMBAYARAN UANG SEKOLAHSD MUHAMMADIYAH BALIKPAPANTAHUN PELAJARAN 2023/2024Alamat : Jl. P. Antasari RT.12 No.31 Sumber Rejo Balikpapan    Nama  :  AAISYAH NUR DZAAKIRAH PUTRI AAMIRAH Kelas:  III ( Tiga ) BBulanTgl.BayarUangSekolahBesarInfakParafJuli250.000,-Agustus250.000,-September250.000,-Oktober250.000,-Nopember250.000,-Desember250.000,-Januari250.000,-Pebruari 250.000,-Maret250.000,-April 250.000,-Mei 250.000,-Juni 250.000,-Keterangan : Pembayaran paling lambat          Tgl. 10 setiap bulannya              Mengetahui                        Balikpapan,1 Juli 2023            Kepala Sekolah                                  Bendahara                    Harini Puji Astuty, S.Pd.SD         Himmatul Jannah, S.Pd.I<img border="0" style="width: 150px; height: 150px;" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAJYAAACWCAIAAACzY+a1AAAAAXNSR0IArs4c6QAAAARnQU1BAACx
